import React from "react";
import "semantic-ui-css/semantic.min.css";
import { Button, Icon, Input } from "semantic-ui-react";
import "./Munch.css";
import "./frontBackground.jpg";

function App() {
  return (
    <div>
      <head>
        <link
          href="https://fonts.googleapis.com/css?family=Almendra SC"
          rel="stylesheet"
        ></link>
      </head>
      <body>
        <h1 class="glowpulsed">Munchkin</h1>
        <div className = "Butt">
          <Input type = "number" placeholder = "Amount of Players"></Input>
        </div>
        <div>
          <Button animated className="Butt">
            <Button.Content visible>Start Game</Button.Content>
            <Button.Content hidden>
              <Icon name="bomb" class="icon"/>
            </Button.Content>
          </Button>
          </div>
      </body>
    </div>
  );
}

export default App;
